import { enumDirection, Vector } from "../../../../core/vector";
import { BaseItem } from "../../../../game/base_item";
import { LogicGateComponent } from "../../../../game/components/logic_gate";
import { enumPinSlotType, WiredPinsComponent, WirePinSlotDefinition } from "../../../../game/components/wired_pins";
import { Entity } from "../../../../game/entity";
import { defaultBuildingVariant } from "../../../../game/meta_building";
import { LogicGateSystem } from "../../../../game/systems/logic_gate";
import { asByteItem, ByteItem } from "../byte/byte_item";
import * as GeoZ from "../../../main";
import { BooleanItem, isTruthyItem } from "../../../../game/items/boolean_item";

export class MetaByteMergerBuilding extends GeoZ.MetaModBuilding {
	static getId() {
		return "byte_merger";
	}

	static getKeybinding() {
		return "K";
	}

	static getTranslations() {
		return {
			variants: {
				[defaultBuildingVariant]: {
					name: "Merger",
					description: "Test GeoZ building for custom item",
				},
				[enumByteMergerVariants.Splitter]: {
					name: "Splitter",
					description: "Test GeoZ building for custom item",
				},
			},
			keybinding: "Byte Gate",
		};
	}

	static getVariants() {
		return [enumByteMergerVariants.Splitter];
	}

	constructor() {
		super("byte_merger");
	}

	getSilhouetteColor() {
		return "#123456";
	}

	getDimensions() {
		return new Vector(8, 1);
	}

	getAvailableVariants() {
		return [...super.getAvailableVariants(null), ...MetaByteMergerBuilding.getVariants()];
	}

	/**
	 * @returns {Layer}
	 */
	getLayer() {
		return "wires";
	}

	/**
	 * @returns {import("../../../mod_building").BuildingSpriteMetas}
	 */
	getSpriteMetas() {
		return {
			[defaultBuildingVariant]: [
				{
					normal: {
						url:
							"data:image/png;base64,",
						width: 1536,
						height: 192,
					},
					blueprint: {
						url:
							"data:image/png;base64,",
						width: 1536,
						height: 192,
					},
				},
			],
			[enumByteMergerVariants.Splitter]: [
				{
					normal: {
						url:
							"data:image/png;base64,",
						width: 1536,
						height: 192,
					},
					blueprint: {
						url:
							"data:image/png;base64,",
						width: 1536,
						height: 192,
					},
				},
			]
		};
	}

	getRenderPins() {
		// We already have it included
		return false;
	}

	/**
	 * @param {Entity} entity
	 * @param {string} variant
	 */
	updateVariants(entity, rotationVariant, variant) {
		entity.components.LogicGate.type = enumVariantToProcessor[variant];

		const pinComp = entity.components.WiredPins;
		const isDefault = variant === defaultBuildingVariant;

		/** @type {Array<WirePinSlotDefinition>} */
		const slots = [{
			pos: new Vector(0, 0),
			direction: isDefault ? enumDirection.top : enumDirection.bottom,
			type: isDefault ? enumPinSlotType.logicalEjector : enumPinSlotType.logicalAcceptor
		}];

		for (let i = 0; i < 8; i++) {
			/** @type {WirePinSlotDefinition} */
			const slot = {
				pos: new Vector(i, 0),
				direction: isDefault ? enumDirection.bottom : enumDirection.top,
				type: isDefault ? enumPinSlotType.logicalAcceptor : enumPinSlotType.logicalEjector
			};
			slots.push(slot);
		}
		pinComp.setSlots(slots);
	}

	/**
	 * Creates the entity at the given location
	 * @param {Entity} entity
	 */
	setupEntityComponents(entity) {
		entity.addComponent(
			new WiredPinsComponent({ slots: [] })
		);

		entity.addComponent(new LogicGateComponent({ type: ByteMerger.getType() }));
	}
}

export const enumByteMergerVariants = {
	Splitter: "Splitter"
};

export class ByteMerger extends GeoZ.ModWireProcessor {
	/**
	 * @param {Array<BaseItem|null>} parameters
	 * @param {LogicGateSystem} system
	 * @returns {Array<BaseItem>|BaseItem}
	 */
	static compute(system, parameters) {
		assert(parameters.length === 8, "bad parameter count for ByteMerger");

		let value = 0;
		for (let i = 0; i < parameters.length; i++) {
			const item = +isTruthyItem(parameters[i]);
			value += item * 2 ** (7 - i);
		}

		return new ByteItem(value);
	}
}

export class ByteSplitter extends GeoZ.ModWireProcessor {
	/**
	 * @param {Array<BaseItem|null>} parameters
	 * @param {LogicGateSystem} system
	 * @returns {Array<BaseItem>|BaseItem}
	 */
	static compute(system, parameters) {
		assert(parameters.length === 1, "bad parameter count for ByteSplitter");

		/** @type {Array<BooleanItem>} */
		const values = [];

		const value = asByteItem(parameters[0]).value.toString(2).padStart(8, "0");
		for (let i = value.length - 1; i > -1; i--) {
			values.push(new BooleanItem(+value[i]));
		}

		return values.reverse();
	}
}

export const enumVariantToProcessor = {
	[defaultBuildingVariant]: ByteMerger.getType(),
	[enumByteMergerVariants.Splitter]: ByteSplitter.getType()
};